import React from 'react';
import Moment from 'react-moment';
import '../../styles/components/weather/_forecast-extra.scss';

export default function ForecastExtra({ forecast }) {
	return (
		<div className="forecast-extra">
			<div key={forecast.dt} className='forecast'>
				<span className='forecast-time'><Moment format="ddd">{ forecast.dt * 1000 }</Moment></span>
			</div>
		</div>
	)
}
